import React , {useEffect, useState} from 'react';
import Axios from 'axios';
import Card from "@material-ui/core/Card";
import './styles/table.css';
import DataTable from 'react-data-table-component';
import {ManagerNavBar} from "../components/ManagerNavBar";

export const Legacy = ()=> {

    //Necessary variables
    const [legTDList, setlegTDList] = useState(
        [
            {
              name: 'ninad',
              addr: 'pcmc',
              cust_mobno: '8450180419',
              td_date: '2022-03-24',
              slot_name: '10:11',
              model: 'BMW-es123',
              type: 'a',
              exe_name: 'ninad',
              exemobno: '7744057803'
            },
            {
              name: 'aditya',
              addr: 'pcmc',
              cust_mobno: '9550180419',
              td_date: '2022-06-24',
              slot_name: '1:4',
              model: 'BMW-es123',
              type: 'a',
              exe_name: 'ninad',
              exemobno: '7744057803'
            },
            {
                name: 'ninad',
                addr: 'pcmc',
                cust_mobno: '8450180419',
                td_date: '2022-03-24',
                slot_name: '10:11',
                model: 'BMW-es123',
                type: 'a',
                exe_name: 'ninad',
                exemobno: '7744057803'
              },
              {
                name: 'aditya',
                addr: 'pcmc',
                cust_mobno: '9550180419',
                td_date: '2022-06-24',
                slot_name: '1:4',
                model: 'BMW-es123',
                type: 'a',
                exe_name: 'ninad',
                exemobno: '7744057803'
              }

            
          ]);

    //required methods

    const showlegacyTD = ()=>{
        Axios.get("http://localhost:3005/legacy").then((response)=> {
            setlegTDList(response.data);
        });
    };


    //Render page code

    const column_legacy = [
        {
            name : 'NAME',
            selector : (row) => row.name
        },
        {
            name : 'ADDRESS',
            selector : (row) => row.addr
        },
        {
            name : 'MOB NO.',
            selector : (row) => row.cust_mobno
        },
        {
            name : 'DATE',
            selector : (row) => row.td_date
        },
        {
            name : 'SLOT',
            selector : (row) => row.slot_name
        }
        ,
        {
            name : 'MODEL',
            selector : (row) => row.model
        },
        {
            name : 'TYPE',
            selector : (row) => row.type
        },
        {
            name : 'EXECUTIVE NAME',
            selector : (row) => row.exe_name
        },
        {
            name : 'EXECUTIVE NO.',
            selector : (row) => row.exemobno
        }

    ];

    //Render page code

    return (
        <div  className='bck' >
            
            {<ManagerNavBar/>}
            <br></br>
            <div >
            <div className='head'><h2>Legacy testdrive</h2></div>
            <div className='table'> 
                <Card>
                <DataTable
                columns={ column_legacy}
                data = {legTDList}
                pagination
                />
                </Card>
                
             </div>
            </div>
        </div>
    );
}
